import styled from 'styled-components'

export const Title = styled.h1 ` 
    font-size: 32;
    font-family: Georgia, 'Times New Roman', Times, serif;
`

export const Container = styled.div ` 
    width: 100%;
    height: auto;
    display: flex;
    flex-direction: "colunm";
`
